import React from "react";
import Foot from "../../assets/images/Foot.png";

export default function Footer() {
  return (
    <div className="bg-black mt-20  ">
      <div className="w-full">
        <img src={Foot} alt="footer " className="w-full  shadow-gray-700 " />
      </div>
    </div>
  );
}
